import React from 'react';
import './Contact.css';
import FacebookIcon from '@material-ui/icons/Facebook';
import InstagramIcon from '@material-ui/icons/Instagram';
import TwitterIcon from '@material-ui/icons/Twitter';
import { IconButton } from '@material-ui/core';

function Contact() {
    
    const mess =()=> {
        alert("Email Us At: abcphoto@snaplib.com");
    };

  return (
    <div className='contact'>
        <div className='contact-box'>
            <div className="mb-3">
                <label for="exampleFormControlInput1" className="form-label">Email address</label>
                <input type="email" className="form-control" id="exampleFormControlInput1" placeholder="name@example.com"/>
            </div>
            <div className="mb-3">
                <label for="exampleFormControlTextarea1" className="form-label">Enter your Query</label>
                <textarea className="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
            </div>
        </div>
        <div className='section-content'>
            <button className='section-button' onClick={mess}>Connect With Us</button>
        </div>
        <div className='follow-link'>
            <h1>Follow Us:</h1>
            <IconButton className='follow-button'>
                <FacebookIcon fontSize='large'/>
            </IconButton>
            <IconButton className='follow-button'>
                <InstagramIcon fontSize='large'/>
            </IconButton>
            <IconButton className='follow-button'>
                <TwitterIcon fontSize='large'/>
            </IconButton>
        </div>
    </div>
  );
};

export default Contact;
